import ReactDOM from "react-dom";

var number  = 0;

function increment(){
    number++;
}

ReactDOM.render(
  <div className="container">
    <h1>{number}</h1>
    <button onc={increment}>+</button>
  </div>,
  document.getElementById("root")
);
